import React from "react";
import "./App.css";
import Postuler from "./components/postuler-aide";
import Accueil from "./components/accueil";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>

          <Route path="/">
            <Accueil />
          </Route>
          <Route path="/">
            <Accueil />
          </Route>
        </Switch>
      </Router>
      <Postuler />
      <Accueil />
    </div>
  );
}

export default App;
